import React from "react";
import "./App.css";
import { UserProvider } from "./context/UserContext";
import LeagueAdmin from "./pages/LeagueAdmin";
import PlayerPage from "./pages/PlayerPage";
import CoachPage from "./pages/CoachPage";

function App() {
  return (
    <UserProvider>
      <div>
        <CoachPage />
        <PlayerPage />
        <LeagueAdmin />
      </div>
    </UserProvider>
  );
}

export default App;
